function processSearch() {
    module('server.log.ApacheLogParser').load(true);
    var searchIn = this.get('searchInMorph').textString,
        user = this.get('userNameMorph').textString,
        lines = Number(this.get('linesMorph').textString);
    server.log.ApacheLogParser.doSearch(user, searchIn, function(reportsByURL) {
            this.report = reportsByURL;
    }.bind(this), lines)
}
